import React from "react";
import notes from "../notes";

function Note(){
    notes.map(noteEntry=>{
        return (<div className = "note">
        <h1>{noteEntry.titl}e</h1>
        <p>{noteEntry.content}</p>
    </div>)
    });
    
}

export default Note ;
